    @SuppressWarnings("deprecation")
	public void PerformTask(String url, String username, String password) {
    	// WebDriver mainWebDriver;

    	LoginPageObject 			loginPage;
    	DoctorDashboardPageObject 	doctorDashboardPage;
    	PatientDashboardPageObject  patientDashboardPage;
    	String error_url; 
    	WebDriver mainWebDriver = null;
    	String timeStamp = "";
    	String result = "";

		try {
			timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
			result = "DEBUG: CheckPoint_1 -> url: " + url + ";" + timeStamp + ";" + username + ";";
			System.out.println(result);

	    	// WebDriver mainWebDriver = TestBase.getDriver();
			mainWebDriver = (WebDriver) TestBase.getDriver(TestBase.APPTYPE_WEB, TestBase.getBrowserType());

			timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
			result = "DEBUG: CheckPoint_2 -> url: " + url + ";" + timeStamp + ";" + username + ";";
			System.out.println(result);

	    	loginPage = new LoginPageObject(expectedValueAppName, mainWebDriver);
			doctorDashboardPage = new DoctorDashboardPageObject(expectedValueAppName, mainWebDriver);
			patientDashboardPage = new PatientDashboardPageObject(expectedValueAppName, mainWebDriver);

			timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
			result = "DEBUG: CheckPoint_3 -> url: " + url + ";" + timeStamp + ";" + username + ";";
			System.out.println(result);
	
			String baseuri = "ciam/api/v1/identity/current-user";
			String tokensList = ""; 

			if (url.toLowerCase().indexOf("patient") != -1) {
				if (!NavigationService.Login(url, loginPage, patientDashboardPage.locHypoglycemiaLabel, username, password)) {
					TestBase.setAbortTestSuite(true);
					throw new SkipException("It seems that the email server where the code for the TFA is obtained is not working now.");			
				};

				timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
				result = "DEBUG: CheckPoint_4 -> url: " + url + ";" + timeStamp + ";" + username + ";";
				System.out.println(result);

				patientDashboardPage.waitUntilLoadComplete();

				tokensList = TestService.getJSNetworkActivity(mainWebDriver, baseuri+ "/patient"); 
			}
			else {
				if (!NavigationService.Login(url, loginPage, doctorDashboardPage.locCreateNewPatientButton, username, password)) {
					TestBase.setAbortTestSuite(true);
					throw new SkipException("It seems that the email server where the code for the TFA is obtained is not working now.");			
				};

				timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
				result = "DEBUG: CheckPoint_4 -> url: " + url + ";" + timeStamp + ";" + username + ";";
				System.out.println(result);

				doctorDashboardPage.waitUntilLoadComplete();

				tokensList = TestService.getJSNetworkActivity(mainWebDriver, baseuri); 
			}

			timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());

			// result = TestService.getJSNetworkActivity(mainWebDriver);
			result = url + ";" + timeStamp + ";" + username + ";" + password + ";" + TestBase.extractTokens(tokensList, ";", "Bearer st2.", ".sc3").get(0).replaceAll("Bearer ", "");
			// result = url + ";" + timeStamp + ";" + username + ";" + password + ";" + TestBase.extractTokens(TestBase.getCookies(mainWebDriver), ";", "st2.", ".sc3").get(0);
			System.out.println("TOKEN: -> " + result);

			try {
				result += "\n"; 

				File file = new File("tokens.txt");
				FileUtils.writeStringToFile(file, result, StandardCharsets.UTF_8, true);
				
				timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
				result = "DEBUG: CheckPoint_6 -> " + url + ";" + timeStamp + ";" + username + ";";
				System.out.println(result);
			}catch (Exception e) {
			    fail("Could not write on the file tokens.txt\n" + e.getMessage());
			}
		} catch(Exception e) {
			error_url = mainWebDriver.getCurrentUrl();
			
			timeStamp = new SimpleDateFormat("yyyy-MMM-dd HH:mm:ss").format(new Date());
			result = "ERROR: url: " + url + ";" + timeStamp + ";" + username + ";" + error_url;
			System.out.println(result);		
		}

		if (mainWebDriver != null) {
			mainWebDriver.quit();
		}
    }

